import { library } from "@fortawesome/fontawesome-svg-core";
import { fas } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { Link } from "react-router-dom";
import React, { useEffect } from "react";
import "../styles/home.css";
import "materialize-css/dist/css/materialize.min.css";

import ott1 from "../img/ott1.webp";
import ott2 from "../img/ott2.webp";
import ott3 from "../img/ott3.webp";
library.add(fas);

function HomePage() {
  return (
    <>
      <div className="container">
        <div className="slide">
          <div
            className="item"
            style={{ backgroundImage: `url(${ott1})` }}
          ></div>
          <div className="content">
            <div className="name-movie">
              <h4>The Mandalorian</h4>
            </div>
            <div className="des-movie">
              After the fall of the Galactic Empire, a lone gunfighter makes his
              way through the outer reaches of the lawless galaxy he show
              follows the adventures of a lone Mandalorian bounty hunter, Din
              Djarin, as he navigates the outer reaches of the galaxy, far from
              the authority of the New Republic.
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
export default HomePage;
<div className="button">
  <Link to="">
    <FontAwesomeIcon icon="fa-solid fa-play" size="xl" className="icon" />
    Play
  </Link>
  <Link to="">
    <FontAwesomeIcon icon="fa-solid fa-plus" size="xl" className="icon" />
    Watch Trailer
  </Link>
</div>;
